import ToDoPage from './components/pages/ToDoPage';
import {BrowserRouter, Switch, Route} from "react-router-dom";
import HopePage from "./components/pages/HomePage/HopePage";

const App = () => (
  <BrowserRouter>
      <Switch>
          <Route path='/'>
              <HopePage />
          </Route>

          <Route path='tasks'>
              <ToDoPage />
          </Route>
      </Switch>
  </BrowserRouter>
);

export default App;
